import { useContext } from 'react';
import { ProductsContext } from '../../context/product.context';
import ProductCard from '../../components/product-card/product-card.component';

const Shop = () => {
  const { products } = useContext(ProductsContext);
  return (
    <div>
      {products.map(({ name }) => (
        <div>
          <h1>{name}</h1>
        </div>
      ))}
    </div>
  );
};
export default Shop;
